import React, { Component } from 'react'
import ShopData from './shop.data';

export default class ShopPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
          collections: ShopData
        };
      }
    render() {
        return (
            <div>
                Shop page
            </div>
        )
    }
}
